if mibBuilder.loadTexts: vsiAvailableChnlWarnThreshold.setDescription('A controller has in its domain multiple instances of the vsiLogicalIfAvailIngressChnls and vsiLogicalIfAvailEgressChnls counters. This set of values, associated with all the logical interfaces in the vsiLogicalIfTable, is monitored so as to note the minimum value. The minimum observed value is compared against this threshold object. If the minimum observed value is less than this threshold, and the value at the last comparison was greater than or equal to this threshold, a single event will be generated, to indicate a warning that available channels are being depleted. After a warning event is generated, another such event will not be generated unless the vsiAvailableChnlAlarmThreshold is reached. If the vsiAvailableChnlAlarmThreshold is reached and then the minimum observed value is greater than or equal to this threshold, a single event is generated, to indicate that a recovery of resources has occurred. If this object contains the value zero, then the thresholding operation will be disabled. Otherwise, the value of this object must be greater than or equal to the value of the associated vsiAvailableChnlAlarmThreshold object. Notification emissions are also gated by the vsiXCTrapEnable object.')
