if mibBuilder.loadTexts: vsiAvailableChnlAlarmThreshold.setStatus('current')
if mibBuilder.loadTexts: vsiAvailableChnlAlarmThreshold.setDescription('A controller has in its domain multiple instances of the vsiLogicalIfAvailIngressChnls and vsiLogicalIfAvailEgressChnls counters. This set of values, associated with all the logical interfaces in the vsiLogicalIfTable, is monitored so as to note the minimum value. The minimum observed value is compared against this threshold object. If the minimum observed value is less than this threshold, and the value at the last comparison was greater than or equal to this threshold, a single event will be generated, to indicate an alarm that available channels are being depleted. After an alarm event is generated, another such event will not be generated unless the vsiAvailableChnlWarnThreshold is reached. If this object contains the value zero, then the thresholding operation will be disabled. Otherwise, the value of this object must be less than or equal to the value of the associated vsiAvailableChnlWarnThreshold object. Notification emissions are also gated by the vsiXCTrapEnable object.')
